(function ($) {
  var alm_is_animating = false;
  $(".alm-filter-nav-news:not(.past-future) li").eq(0).addClass("active");
  $(".alm-filter-nav-news li a").on("click", function (e) {
    e.preventDefault();
    var el = $(this);
    if (
      $(this).hasClass("all-events-trigger") &&
      $(".vergangen-trigger").parent().hasClass("active")
    ) {
      var aktuellePosts = $(".vergangen-trigger").data("post--in");
      $(this).data("post--in", aktuellePosts);
    }
    if (
      $(this).hasClass("all-events-trigger") &&
      $(".aktuelle-trigger").parent().hasClass("active")
    ) {
      var aktuellePosts = $(".aktuelle-trigger").data("post--in");
      $(this).data("post--in", aktuellePosts);
    }
    if (!el.hasClass("active") && !alm_is_animating) {
      alm_is_animating = true;
      el.parent().addClass("active").siblings("li").removeClass("active");
      var data = el.data(),
        transition = "fade",
        speed = "300";
      $.fn.almFilter(transition, speed, data);
    }
  });
  $.fn.almFilterComplete = function () {
    alm_is_animating = false;
  };
})(jQuery);
